import React from 'react';
import Gallery from '../Content/Gallery';
import Footer from '../Footer/Footer';
import TopNavbar from '../Header/TopNavbar';

const Index = () => {
  return (
    <>
    <div className='page'>
              <div id="preloader">
          <div id="status">&nbsp;</div>
        </div>
        <TopNavbar/>
        <div className='site-main'>
        <Gallery/>
        </div>
        <Footer/>
    </div>
    </>
  )
}

export default Index
